column8:
オニオンを練り込んで香ばしく焼きあげたせんべいを、酸味の効いたサワークリーム風味で仕上げました。<br><br>原材料名：でん粉、植物油脂、食用加工油脂、食塩、オニオンパウダー、ホエイパウダー(乳成分を含む)、脱脂粉乳、砂糖、粉末酢、酵母エキスパウダー、小麦粉、乾燥パセリ、えび粉、香味油(小麦・えび・大豆を含む)、ソルビトール、乳化剤(大豆由来)、加工デンプン、調味料(アミノ酸等)、セルロース、酸味料、酸化防止剤(ビタミンE、ビタミンC)、香料(乳由来)、甘味料(スクラロース)、着色料(カロテノイド、ウコン)<br><br><br>■商品詳細<br><table width=630 border=1 cellspacing=0><tr><td bgcolor=#ffffcc><p style=margin:10px;>メーカー名：ブルボン<br>シリーズ名：プチ<br>内容量：38g<br><br>購入単位：1個<br>配送種別：在庫品</p></td></tr></table><br><br><table width=600 border=0 cellspacing=0><tr><td><font size=1>【検索用キーワード】<br>4901360319473 SH5357 9C3111 ブルボン ぶるぼん burubon お菓子 おかし 菓子 かし 食品 しょくひん プチ ぷち プチシリーズ ぷちシリーズ サワークリーム プチサワークリームオニオン サワーオニオン オニオンクリーム オニオン おにおん せんべい せんべえ オニオンせんべい 煎餅 38g</font></td></tr></table><style type="text/css">
